Oh dear. Here we go again.


Look, Babs--it&#39;s really just this simple: if you are scared of lower entities and you think that the hacked radio you are using is really a channel for demon or whatever, then just stop. Put the fricking radio down and go get another hobby. Leave it to those of us who aren&#39;t afraid and don&#39;t care if someone calls us a bitch or a slut and tries to pawn themselves off as Bazoozoo.


Just. Stop. Listening. And. Worrying.


And on top of all that, in this quote below, you seem to be saying that the rest of us don&#39;t know what we&#39;re doing or are being fooled by entities that only you have sussed. Guess what? You&#39;re wrong on both counts, HMO.


Ann



On Jan 21, 2008, at 12:07 PM, babiarz3 wrote:


I&#39;ve recently started analyzing a 40 min 469 session. The results are
scary. I&#39;d say at this point, and I&#39;m only 1/2 way through, 90% of the
communication is negative in nature and mentions many supposed Demonic
names. The layers of voices are, in many cases, multiple. Often, the
listener hears very little of what is actually said. The voices can be
mocking or downright crude. I have not yet formed an opinion fully but
it would seem to me that these models are easy devices for lower level
entities to figure out how to use. I can not speak of the attitudes or
fears of those investigators present although at times, their voices
are a bit shaky. 

Babs
















